demo.repl.help:
Các lệnh khả dụng:
  @show              ─ hiển thị tóm tắt adaptive card gần nhất
  @json              ─ xuất giá trị JSON thô nhận từ luồng
  @back              ─ hoàn nguyên về card/đầu vào bị chặn trước đó
  @input <k>=<v>     ─ đặt hoặc ghi đè một trường đầu vào
  @click <action_id> ─ gửi card với hành động được cung cấp
  @help              ─ in văn bản trợ giúp này
  @quit              ─ thoát REPL
